import styled from 'styled-components';

export const TopSec = styled.div`
  color: #fff;
  background: #101522;
  Min-height: 400px;
  text-align: center;
  padding-top: 2%;
  outline: 2px solid #4b59f7;
`;

export const InfoRow = styled.div`
  display: flex;
  flex-wrap: wrap;
  align-items: center;
  flex-direction: ${({ imgStart }) => (imgStart ? 'row-reverse' : 'row')};
  max-width: 100%;
`;

export const Column = styled.div`
  float: left;
  width: 25%;
  padding: 5px;


`;
